import React, { Component } from 'react';

import '../style.css';

class Interests extends React.Component {
  render(){
    return(
      <div className="container mt-4">
        <h1>Interests</h1>

        <h2>Spread the charm of "Shodo"</h2>
        <h2>How do we reduce the tiresome for working?</h2>
        <h2>Fashion in Watchface art</h2>

      </div>

      )
  }
}

export default Interests;
